import React, { Suspense } from 'react';
import { Canvas } from '@react-three/fiber';
import { Environment, OrbitControls, useGLTF, Plane } from '@react-three/drei';
import * as THREE from 'three';

function TallTree({ position, scale = 1, variation = 0 }) {
  const height = 8 * scale;
  const width = 2 * scale;
  const colors = [
    "#1a472a", // Dark green
    "#2d4a1d", // Forest green
    "#3e5622", // Olive green
    "#2d3b1d"  // Deep forest
  ];

  return (
    <group position={position}>
      {/* Tree trunk with natural curve */}
      <mesh castShadow position={[0, height/2, 0]} rotation={[0.1 * variation, 0, 0.05 * variation]}>
        <cylinderGeometry args={[0.3 * scale, 0.4 * scale, height, 8]} />
        <meshStandardMaterial 
          color="#4a3728" 
          roughness={0.9}
          metalness={0.1}
        />
      </mesh>

      {/* Organic tree foliage */}
      {[...Array(5)].map((_, i) => {
        const layerScale = 1 - (i * 0.15);
        return (
          <mesh 
            key={i} 
            castShadow 
            position={[
              variation * 0.3 * (i - 2),
              height - (i * 1.2 * scale), 
              variation * 0.2 * (i - 2)
            ]}
          >
            <sphereGeometry args={[width * layerScale - (i * 0.1), 16, 16]} />
            <meshStandardMaterial 
              color={colors[i % colors.length]}
              roughness={0.8}
              metalness={0.1}
            />
          </mesh>
        );
      })}
    </group>
  );
}

function DetailedGround() {
  return (
    <group>
      {/* Main grass field */}
      <Plane
        receiveShadow
        rotation={[-Math.PI / 2, 0, 0]}
        position={[0, -0.1, 0]}
        args={[100, 100]}
      >
        <meshStandardMaterial
          color="#90a959"
          roughness={1}
          metalness={0}
        />
      </Plane>

      {/* Grass patches for detail */}
      {[...Array(100)].map((_, i) => {
        const x = Math.random() * 40 - 20;
        const z = Math.random() * 40 - 20;
        const scale = 0.5 + Math.random() * 0.5;
        return (
          <mesh
            key={i}
            position={[x, -0.05, z]}
            rotation={[0, Math.random() * Math.PI, 0]}
            scale={[scale, scale, scale]}
          >
            <planeGeometry args={[0.3, 0.5]} />
            <meshStandardMaterial 
              color={Math.random() > 0.5 ? "#a8b980" : "#7a9943"}
              side={THREE.DoubleSide}
              transparent
              opacity={0.9}
            />
          </mesh>
        );
      })}
    </group>
  );
}

function BackgroundMountains() {
  return (
    <group position={[0, -5, -40]}>
      {/* Main mountain range */}
      <mesh receiveShadow>
        <cylinderGeometry args={[60, 60, 30, 32, 1, true, 0, Math.PI]} />
        <meshStandardMaterial 
          color="#2d4a1d" 
          side={THREE.DoubleSide}
          roughness={0.9}
        />
      </mesh>

      {/* Mountain details */}
      {[...Array(8)].map((_, i) => {
        const x = -30 + (i * 8);
        const height = 15 + Math.random() * 10;
        return (
          <mesh
            key={i}
            position={[x, height/2 - 10, -10]}
            rotation={[0, Math.random() * 0.2 - 0.1, 0]}
          >
            <coneGeometry args={[5 + Math.random() * 3, height, 16]} />
            <meshStandardMaterial 
              color={Math.random() > 0.5 ? "#1a472a" : "#2d4a1d"}
              roughness={0.9}
            />
          </mesh>
        );
      })}
    </group>
  );
}

function NaturalScene() {
  return (
    <group>
      <DetailedGround />
      <BackgroundMountains />

      {/* Background trees with natural variation */}
      {[...Array(25)].map((_, i) => {
        const angle = (i / 25) * Math.PI;
        const radius = 15 + Math.random() * 10;
        const scale = 1 + Math.random() * 0.5;
        const variation = Math.random() * 2 - 1;
        return (
          <TallTree
            key={i}
            position={[
              Math.cos(angle) * radius,
              0,
              Math.sin(angle) * radius - 10
            ]}
            scale={scale}
            variation={variation}
          />
        );
      })}
    </group>
  );
}

function Model() {
  const { scene } = useGLTF('/models/zomepod.glb');

  return (
    <primitive 
      object={scene} 
      scale={1} 
      position={[0, 0, 0]}
      castShadow
      receiveShadow
    />
  );
}

const ModelViewer = () => {
  return (
    <div style={{ width: '100vw', height: '100vh', background: '#87CEEB' }}>
      <Canvas 
        camera={{ position: [20, 10, 20], fov: 45 }}
        shadows
        gl={{ antialias: true }}
        dpr={[1, 2]}
      >
        {/* Enhanced sky and lighting */}
        <color attach="background" args={['#a8c7d6']} />
        <fog attach="fog" args={['#a8c7d6', 30, 100]} />
        <ambientLight intensity={0.7} />
        <directionalLight
          position={[10, 20, 10]}
          intensity={1.5}
          castShadow
          shadow-mapSize-width={2048}
          shadow-mapSize-height={2048}
          shadow-camera-far={50}
          shadow-camera-left={-30}
          shadow-camera-right={30}
          shadow-camera-top={30}
          shadow-camera-bottom={-30}
        />

        <Suspense fallback={null}>
          <Model />
          <NaturalScene />
          <Environment preset="dawn" background blur={0.6} />
        </Suspense>

        <OrbitControls 
          enablePan={true}
          enableZoom={true}
          enableRotate={true}
          minDistance={2}
          maxDistance={40}
          maxPolarAngle={Math.PI / 2.1}
          target={[0, 0, 0]}
        />
      </Canvas>
    </div>
  );
};

useGLTF.preload('/models/zomepod.glb');

export default ModelViewer;
